import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>IT342 Lab1 - React Application</h1>
      <p>Frontend running on port 3000</p>
      <p>Backend API available at http://localhost:8081</p>
    </div>
  );
}

export default App;
